              <div className="body">

              </div>
              <div className="footer">

              </div>
          </div>
        </Grid>
        <Grid item xs={4}>

        </Grid>
        <Grid item xs={4}>

        </Grid>
      </Grid>
    </div>
  );
}
export default Card;
